import React from 'react';

import './nav.css'

class Nav extends React.Component {
    // constructor(props) {
    //     super(props);
    //     this.state = {
            
    //     }
    // }
    render () {
        return (
            <div class="nav-main-div">
                <ul>
                    <li>Home</li>
                    <li>Vehicles</li>
                    <li>Finance</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
                <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/vehicles/">Vehicles</Link>
            </li>
            <li>
              <Link to="/finance/">Finance</Link>
            </li>
            <li>
            <Link to="/about/">About</Link>
            </li>
            <li>
            <Link to="/contact/">Contact</Link>
            </li>
          </ul>
        </nav>
            </div>
        )
    }
}

export default Nav;
